defs.value:
pub enum FieldDescriptorProto_Label {
    LABEL_OPTIONAL = ,
    LABEL_REQUIRED = ,
    LABEL_REPEATED = ,
}

pub enum MethodOptions_IdempotencyLevel {
    IDEMPOTENCY_UNKNOWN = ,
    NO_SIDE_EFFECTS = ,
    IDEMPOTENT = ,
}

pub enum WireType {

    /// Varint (e. g. `int32` or `sint64`)
    WireTypeVarint = ,

    /// Fixed size 64 bit (e. g. `fixed64` or `double`)
    WireTypeFixed64 = ,

    /// Length-delimited (e. g. `message` or `string`)
    WireTypeLengthDelimited = ,

    /// Groups are not supported by rust-protobuf
    WireTypeStartGroup = ,

    /// Groups are not supported by rust-protobuf
    WireTypeEndGroup = ,

    /// Fixed size 64 bit (e. g. `fixed32` or `float`)
    WireTypeFixed32 = ,
}

pub enum WireError {

    /// Could not read complete message because stream is EOF
    UnexpectedEof,

    /// Wrong wire type for given field
    UnexpectedWireType(WireType),

    /// Incorrect tag value
    IncorrectTag(u32),

    /// Malformed map field
    IncompleteMap,

    /// Malformed varint
    IncorrectVarint,

    /// String is not valid UTD-8
    Utf8Error,

    /// Enum value is unknown
    InvalidEnumValue(i32),

    /// Message is too nested
    OverRecursionLimit,

    /// Could not read complete message because stream is EOF
    TruncatedMessage,

    /// Other error
    Other,
}

pub enum ProtobufError {

    /// I/O error when reading or writing
    IoError(io::Error),

    /// Malformed input
    WireError(WireError),

    /// Protocol contains a string which is not valid UTF-8 string
    Utf8(str::Utf8Error),

    /// Not all required fields set
    MessageNotInitialized {
        /// Message name
        message: &'static str,
    },
}

pub fn make_vec_accessor<M,
                         V>(&'static str,
                            for<'a>fn(: &'a M) -> &'a Vec<V::Value>,
                            for<'a>fn(: &'a mut M) -> &'a mut Vec<V::Value>)
-> FieldAccessor where M: Message + 'static, V: ProtobufType + 'static

pub fn make_option_accessor<M,
                            V>(&'static str,
                               for<'a>fn(: &'a M) -> &'a Option<V::Value>,
                               for<'a>fn(: &'a mut M)
                                   -> &'a mut Option<V::Value>)
-> FieldAccessor where M: Message + 'static, V: ProtobufType + 'static

pub fn make_simple_field_accessor<M,
                                  V>(&'static str,
                                     for<'a>fn(: &'a M) -> &'a V::Value,
                                     for<'a>fn(: &'a mut M)
                                         -> &'a mut V::Value) -> FieldAccessor
where M: Message + 'static, V: ProtobufType + 'static

pub enum ReflectFieldRef<'a> {

    /// Singular field, optional or required in proto3 and just plain field in proto3
    Optional(Option<ReflectValueRef>),

    /// Repeated field
    Repeated(&'a ReflectRepeated),

    /// Map field
    Map(&'a ReflectMap),
}

pub enum ReflectValueRef<'a> {

    /// `u32`
    U32(u32),

    /// `u64`
    U64(u64),

    /// `i32`
    I32(i32),

    /// `i64`
    I64(i64),

    /// `f32`
    F32(f32),

    /// `f64`
    F64(f64),

    /// `bool`
    Bool(bool),

    /// `string`
    String(&'a str),

    /// `bytes`
    Bytes(&'a [u8]),

    /// `enum`
    Enum(&'static EnumValueDescriptor),

    /// `message`
    Message(&'a Message),
}

pub enum Field_Cardinality {
    CARDINALITY_UNKNOWN = ,
    CARDINALITY_OPTIONAL = ,
    CARDINALITY_REQUIRED = ,
    CARDINALITY_REPEATED = ,
}

pub enum UnknownValue {

    /// 32-bit unknown (e. g. `fixed32` or `float`)
    Fixed32(u32),

    /// 64-bit unknown (e. g. `fixed64` or `double`)
    Fixed64(u64),

    /// Varint unknown (e. g. `int32` or `bool`)
    Varint(u64),

    /// Length-delimited unknown (e. g. `message` or `string`)
    LengthDelimited(Vec<u8>),
}

pub enum UnknownValueRef<'o> {

    /// 32-bit unknown
    Fixed32(u32),

    /// 64-bit unknown
    Fixed64(u64),

    /// Varint unknown
    Varint(u64),

    /// Length-delimited unknown
    LengthDelimited(&'o [u8]),
}
